import React from 'react';
import { Text, View, Dimensions } from 'react-native';
import { StatusBar } from 'expo-status-bar';
import NavBar from './NavBar';
import { Routes, Route, redirect } from 'react-router-native'

const Main = () => {
    const { width, height } = Dimensions.get('window');

    return (
        <View style={{ width, height, backgroundColor: 'black' }}>
            <StatusBar style="light" />
            <NavBar />
            <Routes>Æ’

                <Route path='/' element={<RepositoryList />} />

                <Route path='/signin' element={<Text>Sign In</Text>} />

                <Route path='*' element={<Navigate to='/' />} />

            </Routes>
            <Text style={{ color: 'white', textAlign: 'center', marginTop: 90, fontSize: 20 }}>DS</Text>
            <Text style={{ color: 'white', textAlign: 'center', fontSize: 20 }}>Sports Data</Text>
        </View>
    );
}

export default Main;
